sys_variable_value.value:
(function execute(inputs, outputs) {

   var responseBody = JSON.parse(inputs['responseBody']);
  gs.info('type'+responseBody);

   var publisherNames =[];
  var data=[];
 /* var prp = responseBody.split(',');
  //gs.info('love'+typeof responseBody[0]);
  prp.forEach(function(property){
    var realProperty =JSON.parse(property);
    gs.info('love'+realProperty.name);
     publisherNames.push({
      label: realProperty.name,
      name: realProperty.name
    });

  });*/
 // gs.info()

   for(var property in responseBody){

   gs.info('Hello'+responseBody[property]['name']);
   publisherNames.push({
        label :responseBody[property]['name'],
        name :responseBody[property]['name']

      });
   }

/*  if(inputs.status == 200 || inputs.status == 201){


    responseBody.forEach(function(property){
      publisherNames.push({
        label :property.name,
        name :property.name

      });
    });
    */




   outputs.skus = {
      data:publisherNames
    };




})(inputs, outputs);

