sys_variable_value.value:
(function execute(inputs, outputs) {
var resourcePath =
        ['subscriptions/',inputs.subscriptionId,'/providers/Microsoft.Compute/locations/',inputs.location,'/publishers/',inputs.publisherName,'/artifacttypes/vmimage/offers/',inputs.offer,'/skus'].join('');


  outputs.resourcepath = resourcePath;

})(inputs, outputs);

